  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;This work will transition commercial
  advanced- yet mature- packaging approaches, such as surface mount and system-in-package,
  into mainstream use at JPL. Starting with an existing Digital Processor Unit (DPU)
  board that is planned to be used on multiple spacecraft in the next decade, we will
  apply modern commercial electronics packaging solutions to create a miniature version
  of the DPU. The DPU has multi I/O communication options (Spacewire, LVDS, 1553,
  TTE) and will target a 1U board form factor, down from existing 6U layout.&amp;nbsp;
  Use performance COTS based devices to provide power and size reduction while maintaining
  performance and universal adaptability.&lt;br /&gt;The DPU hardware will be used
  to demonstrate in-house manufacturability, cost effectiveness, functionality, performance,
  and reliability of state of the art electronics manufacturing and assembly for future-focused
  NASA missions. The implementation of newer packaging technologies will result in
  large decreases in mass, volume, and power of electronic subsystems.&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\":
